// components/DashboardContent.js
import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const data = [
  { name: 'Jan', visits: 2200, orders: 800 },
  { name: 'Feb', visits: 2800, orders: 1200 },
  { name: 'Mar', visits: 1200, orders: 600 },
  { name: 'Apr', visits: 2000, orders: 1000 },
  { name: 'May', visits: 2800, orders: 1500 },
  { name: 'Jun', visits: 3200, orders: 1800 },
];

function DashboardContent() {
  return (
    <div>
      <h2>Dashboard</h2>
      <ResponsiveContainer width="100%" height={400}>
        <LineChart data={data}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="visits" stroke="#8884d8" />
          <Line type="monotone" dataKey="orders" stroke="#82ca9d" />
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
}

export default DashboardContent;
